package javaPrograms;

public class Swap2Numbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("Demo");
		int a = 156, b = 226;
		
		
		System.out.println("Before "+a+ " "+b);
		
		int temp = b;
		b = a; 
		a = temp;
		
		System.out.println("Before "+a+ " "+b);

	}

}
